import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { Icon, InlineIcon } from '@iconify/react';
import paypalIcon from '@iconify/icons-logos/paypal';
import cashappIcon from '@iconify/icons-cib/cashapp';
import venmoIcon from '@iconify/icons-cib/venmo';

class Footer extends Component {
    render() {
        return (
            <div>
                <footer class="page-footer purple darken-2">
                    <div class="container">
                        <div class="row">
                            <div class="col l6 s12">
                                <h5 class="white-text">Footer Content</h5>
                                <p class="grey-text text-lighten-4">You can use rows and columns here to organize your footer content.</p>
                            </div>
                            <div class="col l4 offset-l2 s12">
                                <h5 class="white-text">Links</h5>
                                {/* <ul> */}
                                <Link to="https://www.paypal.com/us/home">
                                <Icon icon={paypalIcon} width="40" height="40"  />         
                                </Link> 
                                <li><Icon icon={paypalIcon} href="https://www.paypal.com/us/home" width="20" height="20" /></li>
                                <li><Icon icon={venmoIcon} /></li>
                                <li><Icon icon={cashappIcon} /></li>
                                <li><a class="grey-text text-lighten-3" href="#!">Link 4</a></li>
                                {/* </ul> */}
                            </div>
                        </div>
                    </div>
                    <div class="footer-copyright">
                        <div class="container">
                            Â© 2020 Group Venture
                            <a class="grey-text text-lighten-4 right" href="#!">More Links</a>
                        </div>
                    </div>
                </footer> 
            </div>
        );
    }
}

export default Footer;



